import React from "react";

import "./Projects.css";

const Project = () => {
  const variants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1 },
  };

  return (
    <div className="Project d-flex flex-column align-items-center justify-content-center">
      <div className="card" style={{ width: "15vw" }}>
        <div className="visible">Hola</div>
        <div class="hidden">Adios</div>
      </div>
    </div>
  );
};

export default Project;
